exports.run = function(message, args) {
  if(message.author.id !== owner.id) return message.channel.createMessage("succ me.");

  if(!args[0] || args[0] == "default") client.editSelf({avatar: "data:image/jpeg;base64,"});
  else if(args[0] == "christmas") client.editSelf({avatar: "data:image/jpeg;base64,"});
  else if(args[0] == "halloween") client.editSelf({avatar: "data:image/png;base64,"});

  return message.channel.createMessage('okay.');
};

exports.info = {
  usage: ")pfp [args]",
  args: "The type of pfp to change to.",
  description: "Lets the owner change the bot's pfp."
};
